The float_eq library also includes assert_float_eq! to accompany the boolean float_eq! operator. To illustrate their use and show some more advanced comparison techniques, we will define a very simple numerical integrator. This function takes an initial value and step size, then advances the value by an arbitrary number of steps: fn integrate(initial: f64, step: f64, count: usize) -> f64 { let mut sum = initial; for _ in 0..count { sum += step; } sum
} Say we want to unit test a number of different sets of input to this algorithm, we might build ourselves a wrapper for it: fn test_integrate(initial: f64, step: f64, count: usize, expected: f64) { let actual = integrate(initial, step, count); assert_float_eq!(actual, expected, r2nd <= f64::EPSILON);
} Note that the syntax for assert, r2nd <= tol is the same as for the boolean form, and that you may use any of the same algorithms if you wish. Arbitrarily, we have begun with the same tolerance as for our first example comparison. This means that the equivalent of our first simple comparison will pass this test just fine: test_integrate(0.2, 0.1, 1, 0.3);

