r1st <= tol
r2nd <= tol
rmax <= tol
rmin <= tol A check to see how far apart two expressions are by comparing the absolute difference between them to an tolerance that is scaled to the granularity of one of the inputs. Mathematically, this is: |a - b| <= func(|a|, |b|) * tol Equivalent to, using f32 as an example: fn float_eq_relative(a: f32, b: f32, tol: f32) -> bool { // the PartialEq check covers equality of infinities a == b || { let chosen = func(a.abs(), b.abs()); (a - b).abs() <= (chosen * tol) }
} Where func is one of: r1st: the first input (a) r2nd: the second input (b) rmax: the larger magnitude (aka rel for legacy reasons) rmin: the smaller magnitude If you are checking for equality versus an expected normal floating point value then you may wish to calculate the tolerance based on that value and so using r1st or r2nd will allow you to select it. If you are generally testing two normal floating point values then rmax is a good general choice. If either number may also be subnormal or close to zero, then you may need to calculate a tolerance based on an intermediate value for an absolute tolerance check instead. Choice of tol will depend on the tolerances inherent in the specific mathematical function or algorithm you have implemented. Note that a tolerance of n * EPSILON (e.g. f32::EPSILON) will test that two expressions are within n representable values of another. However, you should be aware that the errors inherent in your inputs and calculations are likely to be much greater than the small rounding errors this form would imply.

